import Header from './Header';

const layoutStyle = {
  margin: 20,
  padding: 20,
  border: '1px solid #DDD'
};

const Layout = props => (
  <div style={layoutStyle}>
    <meta charset="utf-8"></meta>
    <Header />
    {props.children}
  </div>
);

export default Layout;
